import {AfterViewInit, Component, Injectable, OnInit, ViewChild} from '@angular/core';
import {MatPaginator} from '@angular/material/paginator';
import {MatSort} from '@angular/material/sort';
import {MatTable} from '@angular/material/table';
import {PointResponse} from "../../dto/point-response";
import {PointService} from "../../service/point.service";
import {BehaviorSubject} from "rxjs";

@Component({
  selector: 'app-point-table',
  templateUrl: './point-table.component.html',
  styleUrls: ['./point-table.component.css']
})

export class PointTableComponent implements OnInit {
  @ViewChild(MatTable) table!: MatTable<PointResponse>;
  @ViewChild(MatPaginator) paginator! : MatPaginator;

  displayedColumns = ['x', 'y', 'r', 'currentTime', 'executeTime', 'hit'];
  dataSource: PointResponse[] = [];

  constructor(private service: PointService) {
    console.log("im here");
  }

  ngOnInit(): void {
    this.service.getPoints().subscribe(data => {
      console.log(data);
      this.dataSource = data;
    })
  }

  addPoint(point:PointResponse) {
    this.dataSource.push(point);
    this.table.renderRows();
  }

  clearPoints() {

    this.service.clearPoints();
    this.dataSource = [];
    this.table.renderRows();
  }


}
<div class="demo-button-container">
  <button
    mat-raised-button
    [disabled]="!dataSource.length"
    (click)="clearPoints()"
    class="demo-button">
    Clear points
  </button>
</div>

<div class="mat-elevation-z8">
  <table mat-table class="full-width-table" aria-label="Elements" [dataSource]="dataSource">
    <!-- Id Column -->
    <ng-container matColumnDef="x">
      <th mat-header-cell *matHeaderCellDef mat-header>X</th>
      <td mat-cell *matCellDef="let row">{{row.x}}</td>
    </ng-container>

    <ng-container matColumnDef="y">
      <th mat-header-cell *matHeaderCellDef mat-header>Y</th>
      <td mat-cell *matCellDef="let row">{{row.y}}</td>
    </ng-container>

    <ng-container matColumnDef="r">
      <th mat-header-cell *matHeaderCellDef mat-header>R</th>
      <td mat-cell *matCellDef="let row">{{row.r}}</td>
    </ng-container>

    <ng-container matColumnDef="currentTime">
      <th mat-header-cell *matHeaderCellDef mat-header>CurrentTime</th>
      <td mat-cell *matCellDef="let row">{{row.currentTime}}</td>
    </ng-container>

    <ng-container matColumnDef="executeTime">
      <th mat-header-cell *matHeaderCellDef mat-header>ExecuteTime</th>
      <td mat-cell *matCellDef="let row">{{row.executeTime / 10000}}s</td>
    </ng-container>

    <ng-container matColumnDef="hit">
      <th mat-header-cell *matHeaderCellDef mat-header>Hit</th>
      <td mat-cell *matCellDef="let row">{{row.hit}}</td>
    </ng-container>


    <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
    <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
  </table>


</div>
